+<?php
+
+namespace App\Models;
+
+use Illuminate\Database\Eloquent\Factories\HasFactory;
+use Illuminate\Database\Eloquent\Model;
+
+class ReportFeedback extends Model
+{
+    use HasFactory;
+
+    // The table name (since your table is 'feedback' not the plural)
+    protected $table = 'feedback';
+
+    // Fillable columns (for mass assignment safety)
+    protected $fillable = [
+        'user_id',
+        'rating',
+        'feedback',
+    ];
+
+    // helpful casts
+    protected $casts = [
+        'rating' => 'integer',
+        'created_at' => 'datetime',
+        'updated_at' => 'datetime',
+    ];
+
+    /**
+     * If the feedback is from a registered user.
+     */
+    public function user()
+    {
+        // assuming App\Models\User is your User model
+        return $this->belongsTo(\App\Models\User::class, 'user_id');
+    }
+}
